import logo from "./logo.svg";
import "./App.css";

// JSX : Javascript XML
// ES6

/**
 * element = <div id="root">Hello World</div>
 * element = React.createElement('div', {id: 'root'}, 'Hello World')
 * function createElement(elementType, props, ...children)
 * elementType: 'div', 'p' , 'span'
 * props: những cái attribute của thẻ VD: className,id,href,src,...
 * ...children:
 * element2 = (<div>
 * <span>Hello</span> <span>World</span>
 * </div>)
 * element2 = React.createElement('div',{
 * children:[
 * React.createElement('span', null, 'Hello'),
 * ' ',
 * React.createElement('span',null, 'World')
 * ]
 * })
 */
function Feature() {
  return (
    <div className="feature">
      <h3 className="feature-title">Dinasour</h3>
      <p className="feature-text">
        Lorem ipsum dolor sit amet, consectetur adipisicing elit. Quidem
        dignissimos fuga neque sunt quis quaerat? Soluta reprehenderit
        voluptates nesciunt aperiam quae maiores harum expedita excepturi
        repellendus, ducimus quas cumque sunt.
      </p>
    </div>
  );
}
function App() {
  return (
    <div>
      <YoutubeItem></YoutubeItem>
    </div>
  );
}
// Props = Properties
function YoutubeItem(props) {
  console.log(props);
  return (
    <div className="youtube-item">
      <div className="youtube-image">
        <img src={props.img} alt="" />
      </div>
      <div className="youtube-footer">
        <img
          src="https://images.unsplash.com/photo-1654973206698-9bf5f1378797?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=687&q=80"
          alt=""
          className="youtube-avatar"
        />
        <div className="youtube-info">
          <h3 className="yotube-title">Learning ReactJS From Zero To Hero</h3>
          <h4 className="youtube-author">Tran Dang Khoi</h4>
        </div>
      </div>
    </div>
  );
}

export default App;
